import React from "react";
import { RenderAfterNaverMapsLoaded, NaverMap } from "react-naver-maps";

class App extends React.Component {
  constructor(props) {
    super(props);

    const navermaps = window.naver.maps;

    (this.state = {
      zoomControl: true,
    }),
      (minZoom = 1),
      (maxZoom = 14),
      (this.daegu = new navermaps.LatLngBounds(
        new navermaps.LatLng(35.589898, 128.278994),
        new navermaps.LatLng(36.057008, 128.864702)
      ));
  }

  render() {
    return (
      <div>
        <NaverMap
          style={{
            width: "100%",
            height: "100vh",
          }}
          defaultCenter={{ lat: 35.87, lng: 128.6 }} // 지도 초기 위치
          defaultZoom={12} // 지도 초기 확대 배율
          {...this.daegu}
        />
      </div>
    );
  }
}

export default App;
